for key, value in pairs(unit) do
    if type(value) == "table" and type(value.export) == "table" then
        if value.getMaxVolume and value.getSelfMass then
            ReadyThreshold = ReadyThreshold + 1;
        end
    end
end

LoadedVolume = 0;
--MaxVolume = 0;
LoadedMass = 0;

for key, value in pairs(unit) do
    if type(value) == "table" and type(value.export) == "table" then 
        if value.getMaxVolume and value.getSelfMass then
            value.acquireStorage();     
            --MaxVolume = MaxVolume + value.getMaxVolume();
            LoadedMass = LoadedMass + value.getItemsMass();
            LoadedVolume = LoadedVolume + value.getItemsVolume();
        end
    end
end

if ReadyCheck >= ReadyThreshold and AnythingChanged then

    MergedPayload = {};

    NumBars = 0;
    for id, payload in ipairs(Payloads) do
        for idx, data in ipairs(payload) do
            NumBars = NumBars + 1;
            if MergedPayload[data["class"]] == nil then
                copydata = {};
                for key, var in pairs(data) do
                    copydata[key] = var;
                end
                MergedPayload[data["class"]] = copydata;
            else
                CurrentItem = MergedPayload[data["class"]];
                CurrentItem["quantity"] = CurrentItem["quantity"] + data["quantity"];
                MergedPayload[data["class"]] = CurrentItem;
            end
        end
    end

    NumItems = 0;
    for _, __ in pairs(MergedPayload) do
        NumItems = NumItems + 1;
    end

    AnythingChanged = false;

    unit.setTimer("Update");

end

